window.bookSummaryJSON = "<p><b>Two flares.&nbsp;</b><br> <b>Only one will claim victory.</b><br> <br> Ember has thrown the empire into upheaval. The entire realm knows her face, and her name is whispered in alleys and in the underground. Everyone wants to know what she'll do next, because it's clear she's the only person alive who can challenge their new, strangely powerful emperor. A massive battle is inevitable - and the entire realm is taking sides.<br> <br> There's just one problem. Every time Ember uses her power, she loses a piece of herself. Fighting the emperor could cost her very soul.&nbsp;</p> <p>Meanwhile, Stefan worries that Ember is slipping away from him. As she grows erratic and unpredictable, he's torn between his love for her and his desire to protect the revolutionaries. Can Stefan save the woman he loves? And can Ember fulfill the prophecy written in the stars before she loses herself completely?&nbsp;</p> <p>Experience the thrilling conclusion to the Ember in Space series now - a brand-new trilogy by a&nbsp;<i>USA Today&nbsp;</i>and&nbsp;<i>Wall Street Journal&nbsp;</i>best-selling author for fans of space fantasy, sci-fi mashups, space opera, and science fiction adventure with romance.</p>"; 
